import React, { Component } from "react";
import "./App.css";
import Card from "./Card.js";
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      emojis: [{ emoji: "😁", flipped: false }]
    };
  }

  render() {
    const emojis = [
      "😁",
      "😂",
      "😃",
      "😄",
      "😂",
      "😃",
      "😄",
      "😅",
      "😆",
      "😅",
      "😆",
      "😁"
    ];
    const cards = emojis.map(i => {
      return <Card emoji={i} />;
    });
    return (
      <div className="App">
        This is AIT homework 08.
        {cards}
      </div>
    );
  }
}

export default App;
